package com.entity;

public class Bean {
	private String name;
	private String pass;

	public Bean() {
		// TODO Auto-generated constructor stub
	}
	
	public Bean(String name, String pass) {
		super();
		this.name = name;
		this.pass = pass;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getPass() {
		return pass;
	}

	public void setPass(String pass) {
		this.pass = pass;
	}
	


}
